import React from "react";

const Modal = () => {
  return (
    <div className="modalBackground">
      <div className="ModalContainer">
        <div className="title">
          <h5>Are you sure you want to continue to the test?</h5>
        </div>
        <div className="footer">
          <button>Yes</button>
          <button>No</button>
        </div>
      </div>
    </div>
  );
};

export default Modal;
